import logo from './logo.svg';
// import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './Pages/Home';
import { BrowserRouter,Routes,Route } from 'react-router-dom';

function App() {
  return (
   <>
   <BrowserRouter>
        <Routes>
          <Route exact={true} path="/" elemet={<Home/>}></Route>
        </Routes>
   </BrowserRouter>
   </>
  );
}

export default App;
